import React, { Component } from "react";

export default class CreateExercises extends Component {
  constructor(props) {
    super(props);
    this.state = {
      username:'',
      description:'',
      date: new Date(),
      duration: ''
    }
  }

  render() {
    return (
      <div>
        <p>Exercises</p>
      </div>
    );
  }
}
